import React, { Component } from "react";
import Slider from "react-slick";
import img1 from "../../img/PhotoCarousel/1.jpg"

export default class PhotoCarousel extends Component {
  render() {
    var settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 5,
      initialSlide: 0,
      adaptiveHeight:true,
      centerMode:true,
      responsive: [
        {
          breakpoint: 1024,
          settings: {
            slidesToShow: 3,
            slidesToScroll: 3,
            infinite: true,
            dots: true,
          },
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 2,
            initialSlide: 2,
          },
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
          },
        },
      ],
    };
    return (
      <div >
        
        <Slider className="photo_carousel" {...settings}>
        
        <img src={img1}></img>
        <img src={img1}></img>
        <img src={img1}></img>
        <img src={img1}></img>
        <img src={img1}></img>
        <img src={img1}></img>
        <img src={img1}></img>
        
            
        </Slider>
      </div>
    );
  }
}
